quilt-1.20.1:
  required_when_enabled: true
  update_files:
    - lib/diet.jar
  resource_paths:
    block_textures_dir: 'lib/diet.jar!/assets/diet/textures/block'
    item_textures_dir: 'lib/diet.jar!/assets/diet/textures/item'
