    gui_textures_dir: 'lib/diet.jar!/assets/diet/textures/gui'
    font_textures_dir: 'lib/diet.jar!/assets/diet/textures/font'
    map_textures_dir: 'lib/diet.jar!/assets/diet/textures/map'
    misc_textures_dir: 'lib/diet.jar!/assets/diet/textures/misc'
    mob_effect_textures_dir: 'lib/diet.jar!/assets/diet/textures/mob_effect'
    models_textures_dir: 'lib/diet.jar!/assets/diet/textures/models'
    painting_textures_dir: 'lib/diet.jar!/assets/diet/textures/painting'
    particle_textures_dir: 'lib/diet.jar!/assets/diet/textures/particle'
    trims_textures_dir: 'lib/diet.jar!/assets/diet/textures/trims'
  required_when_enabled: true
  gradle: |
    repositories {
      maven {
        url = 'https://cursemaven.com/'
      }
    }

    tasks.register('diet') {
      ant.mkdir(dir: 'lib/');
      ant.get(src: 'https://edge.forgecdn.net/files/4813/906/diet-quilt-2.1.1%2b1.20.1.jar', dest: 'lib/diet.jar', skipexisting: 'true');
    }

    compileJava.dependsOn diet
    
    dependencies {
      modImplementation fg.deobf('curse.maven:diet-443570:4813906')
    }
